bool ok(int m, int mx) {
    // map<int, int> hash;
    vi hash(N + 1, 0);
    f(i, 0, m) hash[v[i]]++;
    set<int> st;
    f(i, 0, n + 5) 
    {
        if(hash[i] == 0)
        {   
            st.insert(i);
        }
    }
 
    if(*st.begin() == mx) return true;
    f(i, m, n)
    {
        hash[v[i]]++;
        if(st.find(v[i]) != st.end()) st.erase(v[i]);
        hash[v[i - m]]--;
        if(hash[v[i - m]] == 0)
        {
            st.insert(v[i - m]);
        }
    
        if(*st.begin() == mx) return true;
    }
    return false;
}

#include <iostream>
using namespace std;

struct tip_distrib
{
	char nume;
	bool dist1;
	bool dist2;
} tip_prop_cat[4] =
{
	{'a', 1, 0},
	{'e', 1, 1},
	{'i', 0, 0},
	{'o', 0, 1}
};

void prop_cat(char S, int tip, char P)
{
	cout << S << tip_prop_cat[tip].nume << P << "\n";
}

bool PrimTermenPremisa(char numeTermen, int ordine, bool PremisaMajora = true)
{
	if (numeTermen == 'S')
		return ordine / 2 == 0;

	if (numeTermen == 'P')
		return ordine % 2 != 0;

	return (PremisaMajora ? ordine % 2 == 0 : ordine / 2 != 0);
}

bool distribuit(int tip, bool prim_termen)
{
	if (prim_termen)
		return tip_prop_cat[tip].dist1;
	else
		return tip_prop_cat[tip].dist2;
}

bool afirmativ(int tip)
{
	return tip % 2 == 0;
}

bool universal(int tip)
{
	return tip / 2 == 0;
}

bool legea1(int tip1, int tip2, int tip3, int ordine)
{
	return (distribuit(tip1, PrimTermenPremisa('M', ordine, true)) || distribuit(tip2, PrimTermenPremisa('M', ordine, false)));
}

bool legea2(int tip1, int tip2, int tip3, int ordine)
{
	bool respecta = true;

	if (distribuit(tip3, false))
	{
		if (!distribuit(tip1, PrimTermenPremisa('P', ordine)))
			respecta = false;
	}

	if (distribuit(tip3, true))
	{
		if (!distribuit(tip2, PrimTermenPremisa('S', ordine)))
			respecta = false;
	}

	return respecta;
}

bool legea3(int tip1, int tip2, int tip3, int ordine)
{
	return !(afirmativ(tip1) && afirmativ(tip2) && !afirmativ(tip3));
}

bool legea4(int tip1, int tip2, int tip3, int ordine)
{
	return (afirmativ(tip1) || afirmativ(tip2));
}

bool legea5(int tip1, int tip2, int tip3, int ordine)
{
	bool a1 = afirmativ(tip1);
	bool a2 = afirmativ(tip2);

	return !(((a1 && !a2) || (!a1 && a2)) && afirmativ(tip3));
}

bool legea6(int tip1, int tip2, int tip3, int ordine)
{
	return (universal(tip1) || universal(tip2));
}

bool legea7(int tip1, int tip2, int tip3, int ordine)
{
	bool u1 = universal(tip1);
	bool u2 = universal(tip2);

	return !(((u1 && !u2) || (!u1 && u2)) && universal(tip3));
}

bool (*legi[7])(int, int, int, int) = {
	legea1, legea2, legea3, legea4, legea5, legea6, legea7};

bool silogism_valid(int tip1, int tip2, int tip3, int ordine)
{
	for (int i = 0; i < 7; i++)
		if (!legi[i](tip1, tip2, tip3, ordine))
			return false;

	return true;
}

void silogism(int tip1, int tip2, int tip3, int ordine)
{
	(ordine % 2 == 0 ? prop_cat('M', tip1, 'P') : prop_cat('P', tip1, 'M'));
	(ordine / 2 == 0 ? prop_cat('S', tip2, 'M') : prop_cat('M', tip2, 'S'));

	cout << "---\n";
	prop_cat('S', tip3, 'P');
	cout << "\n";
}

int main()
{
	int nValide = 0;

	for (int t1 = 0; t1 < 4; t1++)
		for (int t2 = 0; t2 < 4; t2++)
			for (int t3 = 0; t3 < 4; t3++)
				for (int ord = 0; ord < 4; ord++)
				{
					if (silogism_valid(t1, t2, t3, ord))
					{
						cout << ord + t3 * 4 + t2 * 16 + t1 * 64 + 1 << ". ";
						cout << tip_prop_cat[t1].nume << tip_prop_cat[t2].nume << tip_prop_cat[t3].nume << "-" << ord + 1 << "\n";

						silogism(t1, t2, t3, ord);
						
						nValide++;
					}
				}

	cout << "\n" << nValide << "/256";
}

#include <stdio.h>
#include <stdlib.h>
#include <time.h>

#define N_ALUNOS 10
#define N_EXAMES 3

int main() {
  int minimos[N_EXAMES] = {0};

  srand(time(NULL));
  for (int aluno = 1; aluno <= N_ALUNOS; aluno++) {
    int min_exame = 0,
        min_resultado = rand() % 100;

    for (int exame = 1; exame < N_EXAMES; exame++) {
      int resultado = rand() % 100;
      if (resultado < min_resultado) {
        min_resultado = resultado;
        min_exame = exame;
      }
    }

    printf("Aluno %d teve a menor nota no exame %d\n", aluno, min_exame);
    minimos[min_exame]++;
  }

  printf("\n");
  for (int i = 0; i < N_EXAMES; i++) {
    printf("O exame %d teve %d alunos com a menor nota\n", i+1, minimos[i]);
  }

  return 0;
}

