@Component({
    selector: 'base-bot-main',
    templateUrl: './stream-output.component.html',
    styleUrls: ['./stream-output.component.css']
})
export class StreamOutputComponent implements OnInit, AfterViewInit
{
    private screenWidth: number;
    private screenHeight: number;
    private context: CanvasRenderingContext2D;
    private drawables: Drawable[] = [];
    private pickerwheel: Pickerwheel;

    constructor(public readonly kittenService: KittenService,
                public readonly pictionaryService: PictionaryService,
                public readonly gameboysService: GameboysService,
                public readonly pickerwheelService: PickerwheelService)
    {
    }

    ngOnInit(): void
    {
        this.screenWidth = window.innerWidth;
        this.screenHeight = window.innerHeight;

        this.kittenService.subscribe(KittenMessageType.START, () => this.startKittens());
    }

    ngAfterViewInit(): void
    {
        this.initCanvas();
        this.initKittens();
    }

    private initCanvas()
    {
        const canvas = document.getElementById('canvas') as HTMLCanvasElement;

        canvas.width = this.screenWidth;
        canvas.height = this.screenHeight;

        this.context = canvas.getContext('2d');
        this.context.clearRect(0, 0, this.screenWidth, this.screenHeight);
        this.context.imageSmoothingEnabled = false;

        setInterval(() => this.draw(), 1000 / 30);
    }

    private initKittens()
    {
        const amount = 1000;
        for (let i = 0; i < amount; i++)
        {
            this.drawables.push(new Kitten(this.context));
        }
    }

    private startKittens()
    {
        const canvas = document.getElementById('canvas') as HTMLCanvasElement;
        if (!canvas) {
            return;
        }
        const timeToShow = 5000;
        let counter = 0;

        const kittens = this.drawables.filter(drawable => drawable instanceof Kitten);

        const interval = setInterval(() =>
        {
            if (kittens[counter])
            {
                const kitten = kittens[counter++] as Kitten;
                kitten.updateRandom(
                    Math.floor(Math.random() * this.screenWidth - 150),
                    Math.floor(Math.random() * this.screenHeight - 150));
                kitten.setVisible(true);
                setTimeout(() => kitten.setVisible(false), timeToShow);
            }
            else
            {
                clearInterval(interval);
            }
        }, 1);
    }

    private draw()
    {
        this.context.clearRect(0, 0, this.screenWidth, this.screenHeight);
        this.drawables.forEach(drawable => {
            if (drawable.isVisible())
            {
                drawable.draw(this.context);
            }
        });
    }
}

