def CVBcheck(sentence):
    vowels = 'aeiou'
    consonants = 'bcdfghjklmnpqrstvwxyz'
    vowel_count = 0
    consonant_count = 0
    blank_count = 0
    for char in sentence.lower():
        if char in vowels:
            vowel_count += 1
        elif char in consonants:
            consonant_count += 1
        elif char == ' ':
            blank_count += 1
    return vowel_count, consonant_count, blank_count

