def least_occuring_frequency(string):
    frequency = {}
    
    # Count the frequency of each character
    for char in string:
        if char in frequency:
            frequency[char] += 1
        else:
            frequency[char] = 1
    
    # Find the minimum frequency
    min_frequency = min(frequency.values())
    
    return min_frequency

