from pwn import *
from hashlib import sha256

def xor(a, b):
    return bytes([i ^ j for i, j in zip(a, b)])


def H(m):
    return sha256(m).digest()

def sign(p, msg):
    if isinstance(msg, str):
        msg = msg.encode()
    p.sendlineafter(b"> ", b"1")
    p.sendlineafter(b"Enter your message: ", msg)
    p.recvuntil(b"Hash: ")
    return bytes.fromhex(p.recvline().strip())

def verify(p, msg, sig):
    if isinstance(msg, str):
        msg = msg.encode()
    if isinstance(sig, str):
        sig = sig.encode()
    p.sendlineafter(b"> ", b"2")
    p.sendlineafter(b"Enter your message: ", msg)
    p.sendlineafter(b"Enter your hash: ", sig)
    res = p.recvline().strip()
    return (b"Validated" in res)

def terminate(p):
    p.sendlineafter(b"> ", b"3")
    p.stream()
    p.close()

def main():
    p = remote("94.237.49.182",37748)
    flag = b""
    while b"}" not in flag:
        msg = b"x"*(len(flag)+1)
        sig = sign(p, msg)
        for c in range(128):
            if H(xor(msg, flag+bytes([c]))) == sig:
                flag += bytes([c])
                break
        assert len(flag) == len(msg)
        print(flag)
    terminate(p)

if __name__ == "__main__":
    main()

#include <iostream>
#include <vector>
#include <queue>
#include <algorithm>
using namespace std;
const int maxn = 1e5 + 10;
const int INF = 2e9;
int n, m;
vector<pair<int, pair<int, int>>> graph;
int idx[maxn], sz[maxn];
int root(int x) {
    while(x != idx[x]) {
        idx[x] = idx[idx[x]];
        x = idx[x];
    }
    return x;
}
void join(int a, int b) {
    int root_a = root(a), root_b = root(b);
    if(root_a != root_b) {
        if(sz[root_a] < sz[root_b]) {
            sz[root_b] += sz[root_a];
            idx[root_a] = idx[root_b];
        }
        else {
            sz[root_a] += sz[root_b];
            idx[root_b] = idx[root_a];
        }
    }
}
int main() {
    cin >> n >> m;
    for(int i = 1; i <= n; i++) {
        sz[i] = 1;
        idx[i] = i;
    }
    for(int i = 0; i < m; i++) {
        int a, b, c;
        cin >> a >> b >> c;
        graph.push_back(make_pair(c, make_pair(a, b)));
    }
    sort(graph.begin(), graph.end());
    
    int mst = 0;
    for(int i = 0; i < m; i++) {
        int a = graph[i].second.first;
        int b = graph[i].second.second;
        int c = graph[i].first;
        
        if(root(a) != root(b)) {
            join(a, b);
            mst += c;
        }
    }
    cout << mst << endl;
    return 0;
}
